interface SpinnerAnimationProps {
  color?: string
  size?: number
}

export default function SpinnerAnimation({ color = "#000000", size = 400 }: SpinnerAnimationProps) {
  const svgRef = useRef<SVGSVGElement>(null)
  const tlRef = useRef<gsap.core.Timeline | null>(null)

  useEffect(() => {
    if (!svgRef.current || FRAMES.length === 0) return

    const paths = svgRef.current.querySelectorAll<SVGPathElement>("path")
    if (paths.length === 0) return

    // Show first frame, hide rest
    paths.forEach((p, i) => {
      p.style.display = i === 0 ? "block" : "none"
    })

    const proxy = { frame: 0 }
    let prevFrame = 0

    const tl = gsap.timeline({ id: "spinner", repeat: -1, yoyo: true })
    tl.to(proxy, {
      frame: paths.length - 1,
      duration: 2,
      ease: "none",
      onUpdate() {
        const i = Math.round(proxy.frame)
        if (i === prevFrame) return
        paths[prevFrame].style.display = "none"
        paths[i].style.display = "block"
        prevFrame = i
      },
    })

    tlRef.current = tl

    return () => {
      if (tlRef.current) {
        tlRef.current.kill()
        tlRef.current = null
      }
    }
  }, [])

  // Update fill color reactively
  useEffect(() => {
    if (!svgRef.current) return
    const paths = svgRef.current.querySelectorAll<SVGPathElement>("path")
    paths.forEach((p) => { p.setAttribute("fill", color) })
  }, [color])

  if (FRAMES.length === 0) return null

  return (
    <svg
      ref={svgRef}
      viewBox="0 0 180 180"
      style={{
        width: size,
        height: size,
        fillRule: "evenodd",
        clipRule: "evenodd",
        strokeLinejoin: "round",
        strokeMiterlimit: 2,
      }}
    >
      <g transform="matrix(0.862324,0,0,0.862324,13.051876,12.004754)">
        {FRAMES.map((d, i) => (
          <path
            key={i}
            d={d}
            fill={color}
            style={{ display: i === 0 ? "block" : "none" }}
          />
        ))}
      </g>
    </svg>
  )
}
